// UserService.js
import axios from 'axios';

const BASE_URL_NODE = 'http://localhost:3300/api/v1/users';
const BASE_URL_SPRINGBOOOT = 'http://localhost:8000/api/v1/users' // Replace with your actual API base URL
// const {userid}
const UserService = {
  getAllTravelPlans: () => axios.get(`${BASE_URL_NODE}/travelplans`),
  registerUserToTravelPlan: (userId, travelPlanId) =>
    axios.post(`${BASE_URL_SPRINGBOOT}/${userId}/register/${travelPlanId}`),
  deregisterUserFromTravelPlan: (userId, travelPlanId) =>
    axios.post(`${BASE_URL}/${userId}/deregister/${travelPlanId}`),
  getUserById: (userId) => axios.get(`${BASE_URL}/${userId}`),
};

export default UserService;
